import { Route, Routes } from 'react-router-dom';

import './App.scss';

import Home from './pages/Home';

function App() {
  return (
    <Routes>
      <h1>hello</h1>
      <Route exact path="/" element={ <Home /> }/>

    </Routes>
  );
}

export default App;
